import logo from './img/freecodecamp-logo.png';
import './App.css';

function App() {
  return (
    <div className='App'>
      <div className='freecodecamp-logo-container'>
        <img 
          src={ logo } 
          className='freecodecamp-logo' 
        />
      </div>
    </div>
  );
}

export default App;
